import Home1 from "./Product/HomeOne.vue";
import Home2 from "./Product/HomeTwo.vue";
import Home3 from "./Product/HomeThree.vue";
import Home4 from "./Product/HomeFour.vue";
import { createRouter, createWebHistory } from "vue-router";

const routes = [
  { path: "/homeOne", component: Home1 },
  { path: "/homeTwo", component: Home2 },
  { path: "/homeThree", component: Home3 },
  { path: "/homeFour", component: Home4 },
];

const router = createRouter({
  history: createWebHistory(),
  routes,
});

export default router;
